import Data from './Data';
import Checkbox from './Checkbox';
import { useState } from 'react';

function Formgroup() {
    const [check, setCheck] = useState(false);
    
    return(
        <form>
            <Checkbox></Checkbox>
            <Data></Data>
        </form>
    );
}

export default Formgroup;
